### Main Idea
For chunks `[c1, c2, c3, ..., cn]`, we have to maintain the property: `max(ci) <= min(cj)` if `i < j`. So we can create a monotonously increasing stack `stack` to keep track of the max value for each previous chunk. 

If `arr[i] >= stack.peek()`, we can greedily create a new chunk and `stack.push(arr[i])`. Else, we need to find the previous chunk with max value smaller or equal to `arr[i]`, say `ck`, and we need to merge all the chunks `[c_k+1, ... c_cur]` with `arr[i]`.

To merge chunks, we can just pop all the max values representing those chunks off the stack, and push back the max among them (in our case, it will be stack top cuz this stack is increasing) as the max of the new chunk. 

Finally the size of the stack will be the number of chunks.
### Code
```java
class Solution {
    public int maxChunksToSorted(int[] arr) {
        int n = arr.length;
        Deque<Integer> stack = new ArrayDeque<>();
        for (int num : arr) {
            int max = num;
            while (!stack.isEmpty() && stack.peek() > num) {
                max = Math.max(max, stack.pop());
            }
            stack.push(max);
        }
        return stack.size();
    }
}
```
### Complexity Analysis
Time: `O(n)`
Space: `O(n)`

### Main Idea
Use iteration, process two nodes at a time. Say `tail` is the current tail of the new linked list, we use ListNode `cur` to keep tracks of the current node being processed, `next` is the second node being processed, here are three situations:

1. `cur` is `null`, that means we are done and we can exit the loop.
2. `cur` is not `null`, but `next` is `null`, which means only one node is left, and no need to swap, just append it to the current tail.
3. Neither of them is `null`, so we record the next node to process in `nextCur`, then append `next` to the tail, and  append `cur` to `next`, also need to make `cur.next = null` and set it as the new tail.

To simplify coding and handle edge case, a dummy head is used.

### Code
```java
class Solution {
    public ListNode swapPairs(ListNode head) {
        ListNode dummyHead = new ListNode(), tail = dummyHead, cur = head;
        while (cur != null) {
            ListNode next = cur.next;
            if (next == null) {
                tail.next = cur;
                break;
            } else {
                ListNode nextCur = next.next;
                tail.next = next;
                next.next = cur;
                cur.next = null;
                tail = cur;
                cur = nextCur;
            }
        }
        return dummyHead.next;
    }
}
```

### Complexity Analysis
* Time: `O(n)`
* Space: `O(1)`

