var rotateRight = function(head, k) {
     if (!head || !head.next || k === 0) {
    return head;
  }

  // Step 1: Calculate the length of the linked list
  let length = 1;
  let tail = head;
  while (tail.next) {
    tail = tail.next;
    length++;
  }
  k = k % length;
  if (k === 0) {
    return head;
  }
  let newTail = head;
  for (let i = 0; i < length - k - 1; i++) {
    newTail = newTail.next;
  }
  let newHead = newTail.next;
  newTail.next = null;
  tail.next = head;
  return newHead;
