class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        List<Integer> ori = Arrays.stream(num).boxed().collect(Collectors.toList());
        Collections.reverse(ori);
        List<Integer> ans = new ArrayList<>();
        int remain = k;
        for (int i = 0; i < ori.size(); i++) {
            remain = remain + ori.get(i);
            ans.add(remain%10);
            remain /= 10;
        }
        while (remain > 0) {
            ans.add(remain%10);
            remain /= 10;
        }
        Collections.reverse(ans);
        return ans;
    }
}
``` 
