**思路**： 有点参考前缀思想，统计前缀和后缀中相等的字符出现的位置
```java
class Solution {
    public int[] shortestToChar(String s, char c) {
        int len = s.length();
        int[] pre = new int[len];
        int[] suf = new int[len];
        pre[0] = (s.charAt(0) == c ? 0 : Integer.MAX_VALUE);
        for (int i = 1; i < len; i++) {
            if (s.charAt(i) == c) {
                pre[i] = i;
            } else {
                pre[i] = pre[i-1];
            }
        }

        suf[len-1] = (s.charAt(len-1) == c ? len-1 : Integer.MAX_VALUE);
        for (int i = len - 2; i >= 0; i--) {
            if (s.charAt(i) == c) {
                suf[i] = i;
            } else {
                suf[i] = suf[i+1];
            }
        }

        int[] ans = new int[len];
        for (int i = 0; i < len; i++) {
            ans[i] = Math.min(Math.abs(i-pre[i]), Math.abs(i-suf[i]));
        }
        return ans;
    }
}
```
**时间复杂度**: O(N) 
**空间复杂度**: O(N)

