### 思路
1. 从左到右依次排查
    a. 栈中每一项作为一个区域
    b. 栈中每一项存该区最大值
    c. 如果大于当前栈顶值，当成一个区,推入栈中
    d. 如果小于当前栈，记住当前栈顶值，往下pop，直到找到底 或者 找到比当前数小的那一项为止，推入之前记住的栈顶值
2. 返回栈高度作为最多可分块

