### 思路
1. 根据题目理解，旋转一次就是把尾断掉，然后作为新的头，连到之前的头之前
2. 由于旋转次数有可能大于链表长度，所以偏移量应该为 k mod 长度
3. 所以需要的操作：
    a. 找到链表的长度
    b. 计算出偏移量
    c. 找到最后n+1项目。通过维护一个偏移量长度+1的数组实现，每次超长就把第一个给删掉，从尾部插入新的节点。
    d. 设置新的尾巴：把数组第0个的next指向空
    e. 把之前的尾巴连到旧头：把数组最后一项的next指向旧头
    f. 新的头就是数组的第二项

### 代码
``` javascript
/**
 * Definition for singly-linked list.
 * function ListNode(val, next) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.next = (next===undefined ? null : next)
 * }
 */
/**
 * @param {ListNode} head
 * @param {number} k
 * @return {ListNode}
 */
var rotateRight = function(head, k) {
    if(head === null || head.next === null) return head
    let tmp = head;
    let count = 1
    let arr = []
    while( tmp.next){
        tmp = tmp.next
        count ++
    }
    let shiftNum = k% count;
    if(shiftNum === 0){
        return head
    }
    tmp = head
    while( tmp.next){
        if(arr.length === shiftNum){
            arr.shift()
        }
        arr.push(tmp)
        tmp = tmp.next
        count ++
    }
    arr.push(tmp)
    arr[0].next = null

    arr[arr.length-1].next = head
    return arr[1]

};
```

