// 时间复杂度：O(n)，其中 n 是数组长度
// 空间复杂度：O(n)，需要创建新数组存储结果

思路：
首先计算每个位置左边的最大值 prevMax 和每个位置右边的最小值 nextMin。
然后遍历数组,检查每个位置 i 是否满足 prevMax[i] <= nextMin[i+1]。如果满足,说明可以在位置 i 处切分成一个块。
最后还需要加上最后一个块,所以返回 count + 1。

```
var maxChunksToSorted = function(arr) {
    const n = arr.length;
    let count = 0;
    const prevMax = new Array(n).fill(0);
    const nextMin = new Array(n).fill(0);

    // 计算每个位置左边的最大值
    prevMax[0] = arr[0];
    for (let i = 1; i < n; i++) {
        prevMax[i] = Math.max(prevMax[i - 1], arr[i]);
    }

    // 计算每个位置右边的最小值
    nextMin[n - 1] = arr[n - 1];
    for (let i = n - 2; i >= 0; i--) {
        nextMin[i] = Math.min(nextMin[i + 1], arr[i]);
    }

    // 遍历数组,检查是否可以形成一个块
    for (let i = 0; i < n - 1; i++) {
        if (prevMax[i] <= nextMin[i + 1]) {
            count++;
        }
    }

    // 最后加上最后一个块
    return count + 1;
};
```
时间复杂度 O(n)
空间复杂度 O(n)

